  namespace: nebulae.dotPDFium
  summary: >-
    Represents a web link within a PDF document, providing access to its associated text range, URL, and bounding

    rectangles.
  remarks: >-
    This class allows users to retrieve information about a web link in a PDF, such as its text range,
        URL, and the rectangular regions that define its clickable area. Instances of this class are typically obtained
        through a parent <xref href="nebulae.dotPDFium.PdfText" data-throw-if-not-resolved="false"></xref> object.
