  summary: Gets the number of rectangular areas associated with the current link annotation.
  remarks: >-
    This method retrieves the count of rectangles that represent the clickable regions of a link
        annotation in a PDF document. Each rectangle corresponds to a distinct clickable area.
  example: []
  syntax:
    content: public int GetRectCount()
    return:
      type: System.Int32
      description: >-
