  assemblies:
  - dotPDFium
  namespace: nebulae.dotPDFium
  summary: Retrieves a collection of rectangles currently managed by the system.
  remarks: >-
    Each rectangle in the collection is retrieved lazily as the enumeration progresses. This
        method is suitable for scenarios where the number of rectangles is large or unknown, as it avoids loading all
        rectangles into memory at once.
  example: []
  syntax:
    content: public IEnumerable<FsRect> GetRects()
    return:
      type: System.Collections.Generic.IEnumerable{nebulae.dotPDFium.Native.FsRect}
      description: >-
        An <xref href="System.Collections.Generic.IEnumerable%601" data-throw-if-not-resolved="false"></xref> of <xref href="nebulae.dotPDFium.Native.FsRect" data-throw-if-not-resolved="false"></xref> objects representing the rectangles. The collection will
            be empty if no rectangles are available.
    content.vb: Public Function GetRects() As IEnumerable(Of FsRect)
  overload: nebulae.dotPDFium.PdfWebLink.GetRects*
